import React, {useState} from 'react';
import Grid from '@mui/material/Unstable_Grid2/Grid2';
import ValueChanger from './ValueChanger';
function ScopeChanger(props){
    console.log(props.value);
    const sendChange = (newValue) => {
        props.onValueChange(newValue);
    }
    const properties = props.value['1'];

    return(
        <Grid container columns={16} spacing={1}>
            {/* ROW 1 */}
            <Grid md={3}>
                <ValueChanger property={'connectionString'} value={properties['connectionString']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={3}>
                <ValueChanger property={'waveFormat'} value={properties['waveFormat']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={4}>
                <ValueChanger property={'name'} value={properties['name']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={3}>
                <ValueChanger property={'filePath'} value={properties['filePath']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={3}>
                <ValueChanger property={'fileFormat'} value={properties['fileFormat']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            {/* ROW 1 */}
            {/* ROW 2 */}
            <Grid md={2}>
                <ValueChanger property={'type'} value={properties['type']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'triggerType'} value={properties['triggerType']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'memSize'} value={properties['memSize']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'tdiv'} value={properties['tdiv']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'samplingRate'} value={properties['samplingRate']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'timeOffset'} value={properties['timeOffset']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={2}>
                <ValueChanger property={'triggerLevel'} value={properties['triggerLevel']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>






















            {/* ROW 2 */}
        </Grid>
    )
}

export default ScopeChanger;
